  temperature observations compiled by the New Hampshire Geological Survey, published
  as a web feature service, an ESRI Service, a web map service, and as an Excel spreadsheet
  for the National Geothermal Data System. For more information see links provided.
  This dataset contains 6 worksheets, including information about the template, notes
  related to revisions of the template, Resource provider information, the data, a
  field list (data mapping view) and a worksheet with vocabularies for use in populating
  the spreadsheet (data valid terms). \",\n\t\"license_title\": null,\n\t\"extras\":
